const options = [
  {
    label: "Apple",
    value: "apple",
  },
  {
    label: "Mango",
    value: "mango",
  },
  {
    label: "teste",
    value: "banana",
  },
  {
    label: "Pineapple",
    value: "pineapple",
  },
];

function Create_network() {
  return (
    <div id="App">
      <div className="select-container">
        <select>
          {options.map((option) => (
            <option value={option.value}>{option.label}</option>
          ))}
        </select>
      </div>
    </div>
  );
}
export default Create_network;
